function [lambdaDot, E_p, E_r, E_t] = CostateDerivativesSymbolic6DOF(t,X,dynamics,delta,Phi,eta,etaPrime,constraint) %Done with CRTBP
   %% For CRTBP Dynamics
   if strcmp(dynamics.type,'CRTBP')

    I1_1 = dynamics.inertia(1,1); I1_2 = dynamics.inertia(1,2); I1_3 = dynamics.inertia(1,3);
    I2_1 = dynamics.inertia(2,1); I2_2 = dynamics.inertia(2,2); I2_3 = dynamics.inertia(2,3);
    I3_1 = dynamics.inertia(3,1); I3_2 = dynamics.inertia(3,2); I3_3 = dynamics.inertia(3,3);
    Iinv1_1 = dynamics.inertiaInverse(1,1); Iinv1_2 = dynamics.inertiaInverse(1,2); Iinv1_3 = dynamics.inertiaInverse(1,3);
    Iinv2_1 = dynamics.inertiaInverse(2,1); Iinv2_2 = dynamics.inertiaInverse(2,2); Iinv2_3 = dynamics.inertiaInverse(2,3);
    Iinv3_1 = dynamics.inertiaInverse(3,1); Iinv3_2 = dynamics.inertiaInverse(3,2); Iinv3_3 = dynamics.inertiaInverse(3,3);
    
    W = dynamics.frameRotationRate;
    c = dynamics.exhaustVelocity;
    x_SunL2 = dynamics.x1shift;
    x_EarthL2 = dynamics.x2shift;
    x_OL2 = dynamics.x_OL2;
    mu_1 = dynamics.mu_1;
    mu_2 = dynamics.mu_2;

    r_T1 = X(1); r_T2 = X(2); r_T3 = X(3);
    r1 = X(7); r2 = X(8); r3 = X(9); 
    m = X(13); 
    p1 = X(14); p2 = X(15); p3 = X(16);
    w1 = X(17); w2 = X(18);w3 = X(19);
    lambda_rT1 = X(20); lambda_rT2 = X(21); lambda_rT3 = X(22);
    lambda_vT = X(23:25); 
    lambda_vT1 = X(23); lambda_vT2 = X(24); lambda_vT3 = X(25);
    lambda_r1 = X(26); lambda_r2 = X(27); lambda_r3 = X(28);
    lambda_v = X(29:31); 
    lambda_v1 = X(29); lambda_v2 = X(30); lambda_v3 = X(31);
    lambda_m = X(32); 
    lambda_p1 = X(33); lambda_p2 = X(34); lambda_p3 = X(35);
    lambda_w1 = X(36); lambda_w2 = X(37); lambda_w3 = X(38);

    %% Efficiency improvements for MRP
    pNorm1 = p1^2 + p2^2 + p3^2 + 1;
    pNorm2 = pNorm1^2;
    pNorm13 = pNorm1^3;
    pNorm3 = 4*p1^2 + 4*p2^2 + 4*p3^2 - 4;
    C = cos(W*t);
    S = sin(W*t);

    %% Initialise Costate derivatives (Find with Derive 6dof EOM)
    lambda_rTDot = [
                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                             - lambda_vT1*(W^2*x_OL2 - mu_2/(abs(r_T1 + x_EarthL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(3/2) - mu_1/(abs(r_T1 + x_SunL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(3/2) + (3*mu_2*abs(r_T1 + x_EarthL2)*sign(r_T1 + x_EarthL2)*(r_T1 + x_EarthL2))/(abs(r_T1 + x_EarthL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2) + (3*mu_1*abs(r_T1 + x_SunL2)*sign(r_T1 + x_SunL2)*(r_T1 + x_SunL2))/(abs(r_T1 + x_SunL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2)) - lambda_vT2*((3*mu_2*r_T2*abs(r_T1 + x_EarthL2)*sign(r_T1 + x_EarthL2))/(abs(r_T1 + x_EarthL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2) + (3*mu_1*r_T2*abs(r_T1 + x_SunL2)*sign(r_T1 + x_SunL2))/(abs(r_T1 + x_SunL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2)) - lambda_vT3*((3*mu_2*r_T3*abs(r_T1 + x_EarthL2)*sign(r_T1 + x_EarthL2))/(abs(r_T1 + x_EarthL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2) + (3*mu_1*r_T3*abs(r_T1 + x_SunL2)*sign(r_T1 + x_SunL2))/(abs(r_T1 + x_SunL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2))
        lambda_v1*(mu_2*((3*abs(r_T2)*sign(r_T2)*(r_T1 + x_EarthL2))/(abs(r_T1 + x_EarthL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2) - (3*abs(r2 + r_T2)*sign(r2 + r_T2)*(r1 + r_T1 + x_EarthL2))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2)) + mu_1*((3*abs(r_T2)*sign(r_T2)*(r_T1 + x_SunL2))/(abs(r_T1 + x_SunL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2) - (3*abs(r2 + r_T2)*sign(r2 + r_T2)*(r1 + r_T1 + x_SunL2))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2))) - lambda_v2*(mu_2*(1/(abs(r_T1 + x_EarthL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(3/2) - 1/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(3/2) + (3*abs(r2 + r_T2)*sign(r2 + r_T2)*(r2 + r_T2))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2) - (3*r_T2*abs(r_T2)*sign(r_T2))/(abs(r_T1 + x_EarthL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2)) + mu_1*(1/(abs(r_T1 + x_SunL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(3/2) - 1/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(3/2) + (3*abs(r2 + r_T2)*sign(r2 + r_T2)*(r2 + r_T2))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2) - (3*r_T2*abs(r_T2)*sign(r_T2))/(abs(r_T1 + x_SunL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2))) - lambda_v3*(mu_2*((3*abs(r2 + r_T2)*sign(r2 + r_T2)*(r3 + r_T3))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2) - (3*r_T3*abs(r_T2)*sign(r_T2))/(abs(r_T1 + x_EarthL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2)) + mu_1*((3*abs(r2 + r_T2)*sign(r2 + r_T2)*(r3 + r_T3))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2) - (3*r_T3*abs(r_T2)*sign(r_T2))/(abs(r_T1 + x_SunL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2)))
        lambda_v1*(mu_2*((3*abs(r_T3)*sign(r_T3)*(r_T1 + x_EarthL2))/(abs(r_T1 + x_EarthL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2) - (3*abs(r3 + r_T3)*sign(r3 + r_T3)*(r1 + r_T1 + x_EarthL2))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2)) + mu_1*((3*abs(r_T3)*sign(r_T3)*(r_T1 + x_SunL2))/(abs(r_T1 + x_SunL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2) - (3*abs(r3 + r_T3)*sign(r3 + r_T3)*(r1 + r_T1 + x_SunL2))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2))) - lambda_v3*(mu_2*(1/(abs(r_T1 + x_EarthL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(3/2) - 1/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(3/2) + (3*abs(r3 + r_T3)*sign(r3 + r_T3)*(r3 + r_T3))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2) - (3*r_T3*abs(r_T3)*sign(r_T3))/(abs(r_T1 + x_EarthL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2)) + mu_1*(1/(abs(r_T1 + x_SunL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(3/2) - 1/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(3/2) + (3*abs(r3 + r_T3)*sign(r3 + r_T3)*(r3 + r_T3))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2) - (3*r_T3*abs(r_T3)*sign(r_T3))/(abs(r_T1 + x_SunL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2))) - lambda_v2*(mu_2*((3*abs(r3 + r_T3)*sign(r3 + r_T3)*(r2 + r_T2))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2) - (3*r_T2*abs(r_T3)*sign(r_T3))/(abs(r_T1 + x_EarthL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2)) + mu_1*((3*abs(r3 + r_T3)*sign(r3 + r_T3)*(r2 + r_T2))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2) - (3*r_T2*abs(r_T3)*sign(r_T3))/(abs(r_T1 + x_SunL2)^2 + abs(r_T2)^2 + abs(r_T3)^2)^(5/2)))
         ];
    
    lambda_vTDot = [
          2*W*lambda_vT2 - lambda_rT1
        - lambda_rT2 - 2*W*lambda_vT1
                          -lambda_rT3]; 
    
    lambda_rDot = [
        lambda_v1*(mu_2*(1/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(3/2) - (3*abs(r1 + r_T1 + x_EarthL2)*sign(r1 + r_T1 + x_EarthL2)*(r1 + r_T1 + x_EarthL2))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2)) + mu_1*(1/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(3/2) - (3*abs(r1 + r_T1 + x_SunL2)*sign(r1 + r_T1 + x_SunL2)*(r1 + r_T1 + x_SunL2))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2)) - W^2) - lambda_v3*((3*mu_2*abs(r1 + r_T1 + x_EarthL2)*sign(r1 + r_T1 + x_EarthL2)*(r3 + r_T3))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2) + (3*mu_1*abs(r1 + r_T1 + x_SunL2)*sign(r1 + r_T1 + x_SunL2)*(r3 + r_T3))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2)) - lambda_v2*((3*mu_2*abs(r1 + r_T1 + x_EarthL2)*sign(r1 + r_T1 + x_EarthL2)*(r2 + r_T2))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2) + (3*mu_1*abs(r1 + r_T1 + x_SunL2)*sign(r1 + r_T1 + x_SunL2)*(r2 + r_T2))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2))
                                                                                                                                            lambda_v2*(mu_2*(1/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(3/2) - (3*abs(r2 + r_T2)*sign(r2 + r_T2)*(r2 + r_T2))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2)) + mu_1*(1/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(3/2) - (3*abs(r2 + r_T2)*sign(r2 + r_T2)*(r2 + r_T2))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2)) - W^2) - lambda_v3*((3*mu_2*abs(r2 + r_T2)*sign(r2 + r_T2)*(r3 + r_T3))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2) + (3*mu_1*abs(r2 + r_T2)*sign(r2 + r_T2)*(r3 + r_T3))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2)) - lambda_v1*((3*mu_2*abs(r2 + r_T2)*sign(r2 + r_T2)*(r1 + r_T1 + x_EarthL2))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2) + (3*mu_1*abs(r2 + r_T2)*sign(r2 + r_T2)*(r1 + r_T1 + x_SunL2))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2))
                                                                                                                                                  lambda_v3*(mu_2*(1/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(3/2) - (3*abs(r3 + r_T3)*sign(r3 + r_T3)*(r3 + r_T3))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2)) + mu_1*(1/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(3/2) - (3*abs(r3 + r_T3)*sign(r3 + r_T3)*(r3 + r_T3))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2))) - lambda_v2*((3*mu_2*abs(r3 + r_T3)*sign(r3 + r_T3)*(r2 + r_T2))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2) + (3*mu_1*abs(r3 + r_T3)*sign(r3 + r_T3)*(r2 + r_T2))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2)) - lambda_v1*((3*mu_2*abs(r3 + r_T3)*sign(r3 + r_T3)*(r1 + r_T1 + x_EarthL2))/(abs(r1 + r_T1 + x_EarthL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2) + (3*mu_1*abs(r3 + r_T3)*sign(r3 + r_T3)*(r1 + r_T1 + x_SunL2))/(abs(r1 + r_T1 + x_SunL2)^2 + abs(r2 + r_T2)^2 + abs(r3 + r_T3)^2)^(5/2))];
    
    lambda_vDot = [
          2*W*lambda_v2 - lambda_r1
        - lambda_r2 - 2*W*lambda_v1
                         -lambda_r3
         ];

    lambda_mDot = 0;

    lambda_pDot = [
        lambda_p2*(w3/2 + (p1*w2)/2 - (p2*w1)/2) - lambda_p3*(w2/2 - (p1*w3)/2 + (p3*w1)/2) - lambda_p1*((p1*w1)/2 + (p2*w2)/2 + (p3*w3)/2)
        lambda_p3*(w1/2 + (p2*w3)/2 - (p3*w2)/2) - lambda_p1*(w3/2 + (p1*w2)/2 - (p2*w1)/2) - lambda_p2*((p1*w1)/2 + (p2*w2)/2 + (p3*w3)/2)
        lambda_p1*(w2/2 - (p1*w3)/2 + (p3*w1)/2) - lambda_p2*(w1/2 + (p2*w3)/2 - (p3*w2)/2) - lambda_p3*((p1*w1)/2 + (p2*w2)/2 + (p3*w3)/2)
        ];

    lambda_wDot = [
        lambda_p3*(p2/2 - (p1*p3)/2) - lambda_p2*(p3/2 + (p1*p2)/2) + lambda_w1*(Iinv1_1*(I2_1*w3 - I3_1*w2) - Iinv1_3*(2*I2_1*w1 - I1_1*w2 + I2_2*w2 + I2_3*w3) + Iinv1_2*(2*I3_1*w1 - I1_1*w3 + I3_2*w2 + I3_3*w3)) + lambda_w2*(Iinv2_1*(I2_1*w3 - I3_1*w2) - Iinv2_3*(2*I2_1*w1 - I1_1*w2 + I2_2*w2 + I2_3*w3) + Iinv2_2*(2*I3_1*w1 - I1_1*w3 + I3_2*w2 + I3_3*w3)) + lambda_w3*(Iinv3_1*(I2_1*w3 - I3_1*w2) - Iinv3_3*(2*I2_1*w1 - I1_1*w2 + I2_2*w2 + I2_3*w3) + Iinv3_2*(2*I3_1*w1 - I1_1*w3 + I3_2*w2 + I3_3*w3)) - lambda_p1*(p1^2/4 - p2^2/4 - p3^2/4 + 1/4)
        lambda_p1*(p3/2 - (p1*p2)/2) - lambda_p3*(p1/2 + (p2*p3)/2) - lambda_w1*(Iinv1_2*(I1_2*w3 - I3_2*w1) - Iinv1_3*(I1_1*w1 + 2*I1_2*w2 + I1_3*w3 - I2_2*w1) + Iinv1_1*(I3_1*w1 - I2_2*w3 + 2*I3_2*w2 + I3_3*w3)) - lambda_w2*(Iinv2_2*(I1_2*w3 - I3_2*w1) - Iinv2_3*(I1_1*w1 + 2*I1_2*w2 + I1_3*w3 - I2_2*w1) + Iinv2_1*(I3_1*w1 - I2_2*w3 + 2*I3_2*w2 + I3_3*w3)) - lambda_w3*(Iinv3_2*(I1_2*w3 - I3_2*w1) - Iinv3_3*(I1_1*w1 + 2*I1_2*w2 + I1_3*w3 - I2_2*w1) + Iinv3_1*(I3_1*w1 - I2_2*w3 + 2*I3_2*w2 + I3_3*w3)) + lambda_p2*(p1^2/4 - p2^2/4 + p3^2/4 - 1/4)
        lambda_p2*(p1/2 - (p2*p3)/2) - lambda_p1*(p2/2 + (p1*p3)/2) + lambda_w1*(Iinv1_3*(I1_3*w2 - I2_3*w1) - Iinv1_2*(I1_1*w1 + I1_2*w2 + 2*I1_3*w3 - I3_3*w1) + Iinv1_1*(I2_1*w1 + I2_2*w2 + 2*I2_3*w3 - I3_3*w2)) + lambda_w2*(Iinv2_3*(I1_3*w2 - I2_3*w1) - Iinv2_2*(I1_1*w1 + I1_2*w2 + 2*I1_3*w3 - I3_3*w1) + Iinv2_1*(I2_1*w1 + I2_2*w2 + 2*I2_3*w3 - I3_3*w2)) + lambda_w3*(Iinv3_3*(I1_3*w2 - I2_3*w1) - Iinv3_2*(I1_1*w1 + I1_2*w2 + 2*I1_3*w3 - I3_3*w1) + Iinv3_1*(I2_1*w1 + I2_2*w2 + 2*I2_3*w3 - I3_3*w2)) + lambda_p3*(p1^2/4 + p2^2/4 - p3^2/4 - 1/4)];
            
     E_p = zeros(3,dynamics.numEngines); 
     E_r = zeros(3,dynamics.numEngines);
     E_t = zeros(dynamics.numEngines,1);

     for ii = 1:dynamics.numEngines
        u1 = dynamics.thrustDirectionBody(1,ii); u2 = dynamics.thrustDirectionBody(2,ii); u3 = dynamics.thrustDirectionBody(3,ii);
        T = dynamics.maxThrust(ii);
        if constraint.type == POINTING_CONSTRAINT_TYPE.ELLIPSOIDAL
            a1 = constraint.targetAxisx;
            a2 = constraint.targetAxisy;
            a3 = constraint.targetAxisz;
            d1 = dynamics.engineLocationBody(1,ii); d2 = dynamics.engineLocationBody(2,ii); d3 = dynamics.engineLocationBody(3,ii);

            theta_x = constraint.rotation_x;
            theta_y = constraint.rotation_y;
            theta_z = constraint.rotation_z;

            sigma = diag([1/(a1^2),1/(a2^2),1/(a3^2)]);
            U = constraint.U;

            c0_target1 = constraint.offsetx;
            c0_target2 = constraint.offsety;
            c0_target3 = constraint.offsetz;

            % Compute ellipsoid matrix A
